const board = [
    [null,null,null],
    [null,null,null],
    [null,null,null]
]


export default function GameBoard()
{
    return <ol className="game-board">

        {board.map((row)=>{
            return    <li>
            <ol className="game-board-row">
               { row.map((val,index)=>{
                    return <button>{index}</button>
                })}
            </ol>
            </li>
        })}
    </ol>
}
